import React from "react";

function Link() {
  return (
    <div className="link">
      <a href="/">Accueil</a>
      <a href="/home">Produits</a>
      <a href="/panier">Panier</a> 
      <a href="/cnx">Connexion</a>
      <a href="/signup" onClick={()=>{}}>Deconnexion</a>
    </div>
  );
}

export default Link;
